# Python 'dot product'
def dot(mat, vec):
    acc = 0
    K = len(mat[0])
    for row in mat:
        for i in range(K):
            acc += vec[i] * row[K - i - 1]
    return acc

# Mojo 'equivalent'
    fn dot(self, mult: SIMD[DType.int32, 32]) -> Int:
        var acc = SIMD[DType.int32, 32](0)
        for i in range(0, self.rows, 32):
            acc = self.data.aligned_simd_load[32, 32](i).fma(mult, acc)
        return acc.reduce_add().to_int()
